import raw from './assets/LifeSimulation01.xml';





class map
{

      constructor()
      {

            let lines;
            fetch(raw)
            .then(r=>r.text())
            .then(text=>{
                  lines = text.split('\n');
            })
            this.map_width = parseInt(lines[3]);
            this.map_height = parseInt(lines[6]);
            
      }

      get width() {
            return this.map_width
      }

      get height() {
            return this.map_height
      }

      
      getstuff()
      {
            
      }

}
 
export default map;
